def max_fill(grid, capacity):

    def get_row_max(row):
        return max(row)

    def get_col_max(col):
        return max(col)

    def get_diagonal_max(diagonal):
        return max(diagonal)

    # Find the maximum value in each row, column and diagonal
    row_max = [get_row_max(row) for row in grid]
    col_max = [get_col_max(col) for col in zip(*grid)]
    diag_max = [get_diagonal_max(diagonal) for diagonal in zip(*zip(*grid))]

    # Find the maximum of the three maximums
    max_val = max(row_max + col_max + diag_max)

    # Return the number of times we need to lower the buckets
    return math.ceil(max_val / capacity)

